import React from 'react'

export default function Home() {
    fetch("http://www.omdbapi.com/?i=tt3896198&apikey=3244219b")
        .then(response => response.json())
        .then(data => {
            const list = data
            list.map((item) => {
                console.log(item)
            })
        })
  return (
    <div>Home</div>
  )
}
